import React from "react";
import Link from "next/link";
import Subject from "../components/Subject";
import Footer from "../components/Footer";
import Header from "../components/Header";

class App extends React.Component {
  render() {
    return (
      <div>
        <Header />
        <div className="backimg">
          <div className="transparent">
            <div className="wrap">
              <Subject subject="#目次" />
              <div className="char">
                <Link href="./Page2">
                  <p>
                    <a>1.React</a>
                  </p>
                </Link>
                <p>2.Hello World</p>
                <p>3.JSX</p>
                <p>4.props</p>
                <p>5.component</p>
                <p>6.state</p>
                <p>7.合わせて覚えたいもの</p>
                <p>8.まとめ</p>
              </div>
            </div>
          </div>
          <Footer go="./Page2" />
        </div>
      </div>
    );
  }
}

export default App;
